import React from 'react';

const VideoDetail = ({ selectedVideo }) => {
    console.log("Selected Video: ", selectedVideo);
    if (!selectedVideo){
        return (
        <div>
            Loading...

        </div>)
    }
    else{
         return(
             <div className="ui segment">

                  Video Detail: {selectedVideo.snippet.title}
                  </div>
        )
    }
}

export default VideoDetail;
